import "./styles/ToMesh.css";
import React from "react";
import { BrowserView, MobileOnlyView } from "react-device-detect";
import Desktop_Title from "modules/toMesh/components/TMIntro";
import Header from "modules/toMesh/components/TMTitle";
import { app, messaging } from "modules/toMesh/notification/TMsettingFCM";

const ToMesh = () => {
  const firebaseMessaging = firebaseApp.messaging();
  firebaseMessaging
    .requestPermission()
    .then(() => {
      return firebaseMessaging.getToken(); // 등록 토큰 받기
    })
    .then(function (token) {
      console.log(token); //토큰 출력
    })
    .catch(function (error) {
      console.log("FCM Error : ", error);
    });

  return (
    <>
      <Header></Header>
      <BrowserView>
        <h1>
          <Desktop_Title />
        </h1>
      </BrowserView>
      <MobileOnlyView>
        <h1>
          <Desktop_Title />
        </h1>
      </MobileOnlyView>
    </>
  );
};

export default ToMesh;
